import './sign-in.styles.scss'


class SignIn extends Component {
    constructor(props) {
        super(props);
        this.state = {
            email: '',
            password: ''
        }
    }

    handleChange =(event) =>{
        console.log(event.target.value)
    }

    handleSubmit =(event) => {
        console.log("SUBMITTEDDD")
    }

    render() {
        return (
            <div className='sign-in'>
                <h2>I already have an account</h2>
                <span>SignIn with your email and password.</span>
                <form>
                    <input name='email' onChange= {this.handleChange} type ='email' value={this.state.email} required />
                    <label>Email</label>
                    <input name='password' onChange= {this.handleChange} type ='password' value={this.state.password} required />
                    <label>Password</label>
                    <input type='submit' value='Submit FOOOORM'></input>

                </form>
            </div>
        )
    }
}

export default SignIn;
